import VueRouter from "vue-router";

const router = new VueRouter({
    routes : [
        {   path: '/feature',
            component: Feature 
        },
        {
            path: '/feature',
            component: Feature,
            children: [
                {
                    path: '/feature',
                    component: Feature,
                },
            ],
        },
    ]
})

export default router
